import React, { useState } from 'react';
import './Profile.css';

const Profile = () => {
  const [profile, setProfile] = useState({
    name: '',
    empId: '',
    email: '',
    phone: '',
    department: '',
    photo: '',
  });

  const [editMode, setEditMode] = useState(false);

  const handleInputChange = (event) => {
    const { name, value } = event.target;
    setProfile({ ...profile, [name]: value });
  };

  const handlePhotoChange = (event) => {
    const file = event.target.files[0];
    if (file && file.type.substr(0, 5) === "image") {
      const reader = new FileReader();
      reader.onloadend = () => {
        setProfile({ ...profile, photo: reader.result });
      };
      reader.readAsDataURL(file);
    } else {
      setProfile({ ...profile, photo: '' });
    }
  };

  const handleEditToggle = () => {
    setEditMode(!editMode);
  };

  const handleSave = (event) => {
    event.preventDefault();
    setEditMode(false);
    // TODO: Save profile data to server
  };

  return (
    <div className="profile-container">
      <div className="profile-header">
        {profile.photo ? (
          <img src={profile.photo} alt="Profile" className="profile-photo" />
        ) : (
          <div className="profile-photo-placeholder"></div>
        )}
        {editMode && (
          <input type="file" onChange={handlePhotoChange} className="photo-upload" />
        )}
        <div className="profile-name-edit">
          {editMode ? (
            <input
              type="text"
              value={profile.name}
              name="name"
              onChange={handleInputChange}
              className="name-input"
            />
          ) : (
            <h2>{profile.name}</h2>
          )}
          <span onClick={handleEditToggle} className="edit-toggle">
            {editMode ? 'Save' : 'Edit'}
          </span>
        </div>
        <div className="profile-status">
          <span className="status-indicator"></span>
          Active - {new Date().toLocaleTimeString()}
        </div>
      </div>
      {editMode ? (
        <form onSubmit={handleSave} className="profile-edit-form">
          <label>
            Employee ID:
            <input
              type="text"
              value={profile.empId}
              name="empId"
              onChange={handleInputChange}
            />
          </label>
          <label>
            Email:
            <input
              type="email"
              value={profile.email}
              name="email"
              onChange={handleInputChange}
            />
          </label>
          <label>
            Phone:
            <input
              type="tel"
              value={profile.phone}
              name="phone"
              onChange={handleInputChange}
            />
          </label>
          <label>
            Department:
            <input
              type="text"
              value={profile.department}
              name="department"
              onChange={handleInputChange}
            />
          </label>
          <button type="submit" className="save-btn">Save Changes</button>
        </form>
      ) : (
        <div className="profile-info">
          <p>Employee ID: {profile.empId}</p>
          <p>Email: {profile.email}</p>
          <p>Phone: {profile.phone}</p>
          <p>Department: {profile.department}</p>
        </div>
      )}
    </div>
  );
};

export default Profile;
